INSERT INTO `wp_posts` VALUES (5239, 1, '2018-08-28 08:08:22', '2018-08-28 08:08:22', 'Business Point is responsive multipurpose business theme. It can be used for business, corporate, portfolio, digital agency, landing page, blog, entertainment and all informative websites. Making your website your own is easier than ever before with Business Point.', 'About Business Point', '', 'inherit', 'closed', 'closed', '', '6-revision-v1', '', '', '2018-08-28 08:08:22', '2018-08-28 08:08:22', '', 6, 'http://bridgeportpharmacyservices.com/index.php/2018/08/28/6-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES (5240, 1, '2018-08-28 15:21:11', '2018-08-28 15:21:11', '<p style="font-weight: 400;">You are a pharmacy.  You provide pharmacy services.  Our business is based on accounting services.  Our president has been a CPA for over 20 years with 15 of those years working specifically for pharmacies and pharmacy revenue cycle management companies.  We know how to bill and collect and we know how important cash is for your pharmacy.</p>\r\n<p style="font-weight: 400;">We run an efficient business so that we can offer great rates.  We believe we use the best claims processing system for this line of business and we have a call center that is focused on your pharmacy’s satisfaction.</p>\r\n<p style="font-weight: 400;">We know you have a customer to serve.  We believe that customer is ours when you trust us to handle your back office work.  We try to process your claims with the least amount of rejects possible, but when you do receive a reject message, we try to resolve any issue before you need to call us.  When you do need to call, we answer the phone quickly and work hard to get your prescription processed.  We want to be your favorite vendor.</p>\r\n<p style="font-weight: 400;">You worry about giving your pharmacy patients the best care at the counter and we’ll do the rest</p>', 'Our Services', '', 'publish', 'closed', 'closed', '', 'our-services-2', '', '', '2018-08-28 15:21:11', '2018-08-28 15:21:11', '', 0, 'http://bridgeportpharmacyservices.com/?page_id=5240', 0, 'page', '', 0);
INSERT INTO `wp_posts` VALUES (5241, 1, '2018-08-28 15:21:11', '2018-08-28 15:21:11', '<p style="font-weight: 400;">You are a pharmacy.  You provide pharmacy services.  Our business is based on accounting services.  Our president has been a CPA for over 20 years with 15 of those years working specifically for pharmacies and pharmacy revenue cycle management companies.  We know how to bill and collect and we know how important cash is for your pharmacy.</p>\r\n<p style="font-weight: 400;">We run an efficient business so that we can offer great rates.  We believe we use the best claims processing system for this line of business and we have a call center that is focused on your pharmacy’s satisfaction.</p>\r\n<p style="font-weight: 400;">We know you have a customer to serve.  We believe that customer is ours when you trust us to handle your back office work.  We try to process your claims with the least amount of rejects possible, but when you do receive a reject message, we try to resolve any issue before you need to call us.  When you do need to call, we answer the phone quickly and work hard to get your prescription processed.  We want to be your favorite vendor.</p>\r\n<p style="font-weight: 400;">You worry about giving your pharmacy patients the best care at the counter and we’ll do the rest</p>', 'Our Services', '', 'inherit', 'closed', 'closed', '', '5240-revision-v1', '', '', '2018-08-28 15:21:11', '2018-08-28 15:21:11', '', 5240, 'http://bridgeportpharmacyservices.com/index.php/2018/08/28/5240-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES (5242, 1, '2018-08-28 15:23:19', '2018-08-28 15:23:19', '<h2><strong>Service</strong></h2>\r\nWe believe the pharmacy comes first. We exist because you trust us to process your prescriptions.  We will work hard to keep you happy and earn your business every day. We hire great people who believe in what we do.\r\n<h2><strong>Rates</strong></h2>\r\nBridgeport is company owned and will not play games with the rates we offer to you just to meet increasing profit goals.  We offer a simple rate structure that doesn’t change.  We setup a rate structure that works for you. As AWP rates increase, your payments increase.  If you work with us to implement small processes that help us reduce our bad debt, we can offer even better rates.\r\n<h2><strong>Volume</strong></h2>\r\nWe want your market share to increase.  We visit the doctors around you to educate them about our program and promote your pharmacy.', 'Why Bridgeport?', '', 'publish', 'closed', 'closed', '', 'why-bridgeport', '', '', '2018-08-28 15:23:19', '2018-08-28 15:23:19', '', 0, 'http://bridgeportpharmacyservices.com/?page_id=5242', 0, 'page', '', 0);
INSERT INTO `wp_posts` VALUES (5243, 1, '2018-08-28 15:23:19', '2018-08-28 15:23:19', '<h2><strong>Service</strong></h2>\r\nWe believe the pharmacy comes first. We exist because you trust us to process your prescriptions.  We will work hard to keep you happy and earn your business every day. We hire great people who believe in what we do.\r\n<h2><strong>Rates</strong></h2>\r\nBridgeport is company owned and will not play games with the rates we offer to you just to meet increasing profit goals.  We offer a simple rate structure that doesn’t change.  We setup a rate structure that works for you. As AWP rates increase, your payments increase.  If you work with us to implement small processes that help us reduce our bad debt, we can offer even better rates.\r\n<h2><strong>Volume</strong></h2>\r\nWe want your market share to increase.  We visit the doctors around you to educate them about our program and promote your pharmacy.', 'Why Bridgeport?', '', 'inherit', 'closed', 'closed', '', '5242-revision-v1', '', '', '2018-08-28 15:23:19', '2018-08-28 15:23:19', '', 5242, 'http://bridgeportpharmacyservices.com/index.php/2018/08/28/5242-revision-v1/', 0, 'revision', '', 0);
